static uint16_t iwt_matrix_ref[NUM_QM_LEVELS][2][2]
                              [4 * 4 + 8 * 8 + 16 * 16 + 32 * 32 + 32 * 16];
static uint16_t wt_matrix_ref[NUM_QM_LEVELS][2][2]
                             [4 * 4 + 8 * 8 + 16 * 16 + 32 * 32 + 32 * 16];

void aom_qm_init(AV1_COMMON *cm) {
  int q, c, f, t, size;
  int current;
  for (q = 0; q < NUM_QM_LEVELS; ++q) {
    for (c = 0; c < 2; ++c) {
      for (f = 0; f < 2; ++f) {
        current = 0;
#if CONFIG_CB4X4
        cm->gqmatrix[q][c][f][TX_2X2] = &wt_matrix_ref[NUM_QM_LEVELS - 1][c][f][0];
        cm->giqmatrix[q][c][f][TX_2X2] = &iwt_matrix_ref[NUM_QM_LEVELS - 1][c][f][0];
        for (t = 1; t < TX_SIZES; ++t) {
          size = tx_size_2d[t];
          cm->gqmatrix[q][c][f][t] = &wt_matrix_ref[q][c][f][current];
          cm->giqmatrix[q][c][f][t] = &iwt_matrix_ref[q][c][f][current];
          current += size;
        }
#else
        for (t = 0; t < TX_SIZES; ++t) {
          size = tx_size_2d[t];
          cm->gqmatrix[q][c][f][t] = &wt_matrix_ref[q][c][f][current];
          cm->giqmatrix[q][c][f][t] = &iwt_matrix_ref[q][c][f][current];
          current += size;
        }
#endif
        // Point all other matrices at the 32x16 matrix
        for (t = TX_4X8; t < TX_SIZES_ALL; ++t) {
          cm->gqmatrix[q][c][f][t] = &wt_matrix_ref[q][c][f][current];
          cm->giqmatrix[q][c][f][t] = &iwt_matrix_ref[q][c][f][current];
        }
      }
    }
  }
}
